To manage tiles and coordinates we are going to make our first component, Coordinates: // coordinates.rs
use std::fmt::{self, Display, Formatter};
use std::ops::{Add, Sub};
use bevy::prelude::Component; #[cfg_attr(feature = "debug", derive(bevy_inspector_egui::Inspectable))]
#[derive(Debug, Default, Copy, Clone, Ord, PartialOrd, Eq, PartialEq, Hash, Component)]
pub struct Coordinates { pub x: u16, pub y: u16,
} // We want to be able to make coordinates sums..
impl Add for Coordinates { type Output = Self; fn add(self, rhs: Self) -> Self::Output { Self { x: self.x + rhs.x, y: self.y + rhs.y, } }
} // ..and subtractions
impl Sub for Coordinates { type Output = Self; fn sub(self, rhs: Self) -> Self::Output { Self { x: self.x.saturating_sub(rhs.x), y: self.y.saturating_sub(rhs.y), } }
} impl Display for Coordinates { fn fmt(&self, f: &mut Formatter<'_>) -> fmt::Result { write!(f, "({}, {})", self.x, self.y) }
} The Coordinate struct contains unsigned numeric values representing both axis of the board. We add theDisplay implementation as a good practice, and the Add and Sub implementation to allow numeric operations. Notice the use of saturating_sub to avoid panic if the subtraction result is negative. We add the Inspectable derive through our debug feature gate. This trait will make our component display correctly in the inspector GUI. Why do a component here ? We won't use Coordinates as component yet, but we will in future steps. This illustrates one of bevy aspects: anything can be a component if you derive Component. We also added a bunch of derive attributes which will be useful in the future.

